	/**
	 *
	 * @param __app
	 *
	 * @return
	 */
	public static void exec ( RallyApplication __app )
	{
		ParameterSet ps = null;
		TANFE_ADL.exec ( __app, ps );
	}


	/**
	 * Overrides the ancestor's method
	 * 
	 * @param __app
	 */
	public void setApplication ( RallyApplication __app )
	{
		this.app = ( SAIC_DMQ_ORA_Application ) __app;
		if ( this.app != null )
		{
			this.dm = ( RallyDataManager ) this.app.getDataManager ( );
		}
	}


	/**
	 * Overrides the ancestor's method
	 * 
	 * @param parms
	 */
	public void execute ( ParameterSet parms )
	{
		this.process ( parms );
	}




	/**
	 *
	 */
	protected void doReturn ( )
	{
		this.unregister ( );
	}


	/**
	 *
	 */
	public void unregister ( )
	{
		this.app.unregister ( this );
		IRegisteredObject rObj = this.app.get ( "TANFE_ADL" );
		if ( rObj != null && rObj instanceof TANFE_ADL )
		{
			this.app.setADL ( TANFE_ADL.class, ( TANFE_ADL ) rObj );
		}
	}


	/**
	 * Overrides the ancestor's method
	 * 
	 * @param ps
	 */
	protected void process ( ParameterSet ps )
	{
		Debug.println ( Debug.TRACE, "TANFE_ADL Step " + this.currentStep );
		super.process ( ps );
		switch ( this.currentStep ) 
		{
		case 0:  { this.currentStep ++; this.step0 ( this.keyParms ); break; }
		case 1:  { this.currentStep ++; this.step1 ( this.keyParms ); break; }
		case 2:  { this.currentStep ++; this.step2 ( this.keyParms ); break; }
		default: 
		{ 
			this.currentStep = 0;
			Debug.println ( Debug.TRACE, "TANFE_ADL ended" );
			this.unregister ( );
			break;
		}
		}
		if ( this.currentStep > 0 ) this.app.goOn ( );
	}



	/**
	 *
	 */
	protected void step0 ( ParameterSet ps )
	{
		this.app.form ( "TANFE_FR" ).setItem ( "NOMBRE", " "  );
		this.app.form ( "TANFE_FR" ).setItem ( "ACTIVIDAD", " "  );
		this.app.form ( "TANFE_FR" ).setItem ( "TECNICO_CASO", ""  );
		this.app.form ( "TANFE_FR" ).setItem ( "SEGSOC",  this.app.SS_SERV_GBL );

		CLIENTES2_RO_DSD = this.dm.create ( "CLIENTES2_RO_DSD" );
		OPEN_ID = CLIENTES2_RO_DSD.getId ( );
		STATUS_ID = RallyDataStoreException.getDefault ( );
		SERVICIOS2_DSD = this.dm.create ( "SERVICIOS2_DSD" );
		OPEN2_ID = SERVICIOS2_DSD.getId ( );
		STATUS2_ID = RallyDataStoreException.getDefault ( );
		GENERAL_TBL_DSD = this.dm.create ( "GENERAL_TBL_DSD" );
		OPEN3_ID = GENERAL_TBL_DSD.getId ( );
		STATUS3_ID = RallyDataStoreException.getDefault ( );
		RMO_RO_DSD = this.dm.create ( "RMO_RO_DSD" );
		OPEN4_ID = RMO_RO_DSD.getId ( );
		STATUS4_ID = RallyDataStoreException.getDefault ( );
		SERV_SOST2_DSD = this.dm.create ( "SERV_SOST2_DSD" );
		OPEN5_ID = SERV_SOST2_DSD.getId ( );
		STATUS5_ID = RallyDataStoreException.getDefault ( );

		STATUS_ID  = this.dm.reset ( OPEN_ID );

		this.dm.setField ( this.dm.get ( "CLIENTES2_RO_DSD" ), "SEGURO_SOCIAL_CLIENTE", this.app.SS_SERV_GBL );
		this.dm.setField ( this.dm.get ( "CLIENTES2_RO_DSD" ), "RMO_OFICINA", this.app.RMO_GBL );

		STATUS_ID  = this.dm.limitQueryFromBuffer ( OPEN_ID );
		STATUS_ID  = this.dm.retrieve ( OPEN_ID );

		if ( ! Compare.equals ( STATUS_ID, 0 ) ) 
		{
			this.app.setError ( 0, STATUS_ID );
			this.doReturn ( );
			return; 
		}

		STATUS_ID  = this.dm.firstRow ( OPEN_ID );

		if ( ! Compare.equals ( STATUS_ID, 0 ) ) 
		{
			this.app.setError ( 1, STATUS_ID );
			this.doReturn ( );
			return; 
		}

		this.callParms.clear ( );
		this.callParms.set ( this.dm.getFieldDouble ( this.dm.get ( "CLIENTES2_RO_DSD" ), "RMO_OFICINA" )  );
		this.callParms.set ( REGION  );
		this.callParms.set ( MUNI  );
		this.callParms.set ( OFICINA  );
		GET_RMO_INFO_ADL.exec ( this.app, this.callParms );
		return;

	}

	protected void step1 ( ParameterSet ps )
	{
		this.callParms.reset ( );
		this.dm.setField ( this.dm.get ( "CLIENTES2_RO_DSD" ), "RMO_OFICINA", this.callParms.getDouble ( ) );
		REGION  = this.callParms.getString ( );
		MUNI  = this.callParms.getString ( );
		OFICINA  = this.callParms.getString ( );
		this.app.form ( "TANFE_FR" ).setItem ( "REGION", REGION  );
		this.app.form ( "TANFE_FR" ).setItem ( "OFICINA", OFICINA  );
		this.app.form ( "TANFE_FR" ).setItem ( "NOMBRE", this.dm.getFieldString ( this.dm.get ( "CLIENTES2_RO_DSD" ), "DSC_NOMBRE" ) + " " + this.dm.getFieldString ( this.dm.get ( "CLIENTES2_RO_DSD" ), "DSC_INICIAL" ) + " " + this.dm.getFieldString ( this.dm.get ( "CLIENTES2_RO_DSD" ), "DSC_APELLIDO_PATERNO" ) + " " + this.dm.getFieldString ( this.dm.get ( "CLIENTES2_RO_DSD" ), "DSC_APELLIDO_MATERNO" )  );
		this.app.form ( "TANFE_FR" ).setItem ( "SEGSOC",this.dm.getFieldDouble(this.dm.get ("CLIENTES2_RO_DSD"),"SEGURO_SOCIAL_CLIENTE"));
		STATUS_ID  = this.dm.dbClose ( OPEN_ID );

		STATUS2_ID  = this.dm.reset ( OPEN2_ID );

		this.dm.setField ( this.dm.get ( "SERVICIOS2_DSD" ), "SEGURO_SOCIAL_JEFE_FAM", this.app.SS_JEFE_GBL );
		this.dm.setField ( this.dm.get ( "SERVICIOS2_DSD" ), "SEGURO_SOCIAL_JEFE_SERV", this.app.SS_SERV_GBL );
		SEGSOC = this.dm.getFieldDouble( this.dm.get ( "SERVICIOS2_DSD" ), "SEGURO_SOCIAL_JEFE_SERV");
		this.dm.setField ( this.dm.get ( "SERVICIOS2_DSD" ), "COD_SERVICIO", this.app.COD_SERV_GBL );
		this.dm.setField ( this.dm.get ( "SERVICIOS2_DSD" ), "RMO_OFICINA", this.app.RMO_GBL );

		STATUS2_ID  = this.dm.limitQueryFromBuffer ( OPEN2_ID );
		STATUS2_ID  = this.dm.retrieve ( OPEN2_ID );

		if ( ! Compare.equals ( STATUS2_ID, 0 ) ) 
		{
			this.app.setError ( 2, STATUS2_ID );
			this.doReturn ( );
			return; 
		}

		STATUS2_ID  = this.dm.firstRow ( OPEN2_ID );

		if ( ! Compare.equals ( STATUS2_ID, 0 ) ) 
		{
			this.app.setError ( 3, STATUS_ID );
			this.doReturn ( );
			return; 
		}

		STATUS5_ID  = this.dm.reset ( OPEN5_ID );

		this.dm.setField ( this.dm.get ( "SERV_SOST2_DSD" ), "SEGURO_SOCIAL_JEFE_SERV", SEGSOC );

		STATUS5_ID  = this.dm.limitQueryFromBuffer ( OPEN5_ID );
		STATUS5_ID  = this.dm.retrieve ( OPEN5_ID );

		STATUS5_ID  = this.dm.firstRow ( OPEN5_ID );
		while ( Compare.equals ( STATUS5_ID, 0 ) ) 
		{
			this.app.form ( "TANFE_FR" ).setItem ("FCH_NOTIFICACION",  this.app.SYSTEM_DATE);
			this.app.form ( "TANFE_FR" ).setItem ("MES_PAGO", TruncService.trunc ( this.app.SYSTEM_DATE, "MMM" )  );
			
			///
			STATUS3_ID  = this.dm.reset ( OPEN3_ID );

			this.dm.setField ( this.dm.get ( "GENERAL_TBL_DSD" ), "COD_GENERAL", "ACTI" );
			this.dm.setField ( this.dm.get ( "GENERAL_TBL_DSD" ), "COD_ID", this.dm.getFieldString( this.dm.get("SERV_SOST2_DSD"), "ACTIVIDAD") );

			STATUS3_ID  = this.dm.limitQueryFromBuffer ( OPEN3_ID );
			STATUS3_ID  = this.dm.retrieve ( OPEN3_ID );

			if ( ! Compare.equals ( STATUS3_ID, 0 ) ) 
			{
				this.app.setError ( 2, STATUS3_ID );
				this.doReturn ( );
				return; 
			}

			STATUS3_ID  = this.dm.firstRow ( OPEN3_ID );

			if ( ! Compare.equals ( STATUS3_ID, 0 ) ) 
			{
				this.app.setError ( 3, STATUS3_ID );
				this.doReturn ( );
				return; 
			}
			this.app.form ( "TANFE_FR" ).setItem ("ACTIVIDAD", this.dm.getFieldString( this.dm.get("GENERAL_TBL_DSD"), "DSC_LARGA") );
			///
			    pago = this.dm.getFieldDouble( this.dm.get("SERV_SOST2_DSD"), "PAGO_POR_DIA") ;
				STATUS5_ID  = this.dm.nextRow ( OPEN5_ID );
			}			
		this.app.form ( "TANFE_FR" ).setItem ("PAGO_MES_TOTAL",pago);
		this.app.form ( "TANFS_FR" ).setItem ("TOTAL",pago);
		this.app.form ( "TANFS_FR" ).setItem ("FCH_COMIENZO2",this.dm.getFieldDate(this.dm.get ("SERVICIOS2_DSD"),"FCH_COMIENZO"));
		this.app.form ( "TANFS_FR" ).setItem ("FCH_TERMINA2",this.dm.getFieldDate(this.dm.get ("SERVICIOS2_DSD"),"FCH_TERMINA"));
		this.dm.setField ( this.dm.get ( "SERVICIOS2_DSD" ), "VLR_BENEFICIOS", pago);
		this.dm.setField ( this.dm.get ( "SERVICIOS2_DSD" ), "BENEFICIO_ANTERIOR", pago);
		this.dm.setField ( this.dm.get ( "SERVICIOS2_DSD" ), "FCH_DECISION", TruncService.trunc ( this.app.SYSTEM_DATE, "DDD" )  );
		this.dm.setField ( this.dm.get ( "SERVICIOS2_DSD" ), "FCH_TRANS", TruncService.trunc ( this.app.SYSTEM_DATE, "DDD" )  );
		this.dm.setField ( this.dm.get ( "SERVICIOS2_DSD" ), "ID_TECNICO_DETER_ELEGIBILIDAD", this.app.ID_TECNICO_GBL );
		this.dm.setField ( this.dm.get ( "SERVICIOS2_DSD" ), "COD_STATUS_SERVICIO",DETERMINAR_ELEGIBILIDAD_TANFE.getSERVICIO_STATUS(this.app));
		STATUS2_ID = this.dm.update(OPEN2_ID);
		STATUS2_ID  = this.dm.dbClose ( OPEN2_ID );
		STATUS3_ID  = this.dm.dbClose ( OPEN3_ID );
		return;
	}
	protected void step2 (ParameterSet ps)
	{
		if ( Compare.equals ( this.app.DETERMINACION_FINAL_GBL, "S" ) ) 
		{
			PRESUPUESTO_LOC_DSD = this.dm.create ( "PRESUPUESTO_LOC_DSD" );
			PRESUPUESTO_LOC = PRESUPUESTO_LOC_DSD.getId ( );
			PRESUPUESTO_LOC_STAT = RallyDataStoreException.getDefault ( );
			PRESUPUESTO_LOC_STAT  = this.dm.reset ( PRESUPUESTO_LOC );
			this.dm.setField ( this.dm.get ( "PRESUPUESTO_LOC_DSD" ), "SEGURO_SOCIAL_JEFE_SERV", this.app.SS_SERV_GBL );
			this.dm.setField ( this.dm.get ( "PRESUPUESTO_LOC_DSD" ), "COD_SERVICIO", this.app.COD_SERV_GBL );
			PRESUPUESTO_LOC_STAT  = this.dm.limitQueryFromBuffer ( PRESUPUESTO_LOC );
			PRESUPUESTO_LOC_STAT  = this.dm.retrieve ( PRESUPUESTO_LOC );
			PRESUPUESTO_LOC_STAT  = this.dm.firstRow ( PRESUPUESTO_LOC );
			boolean tempBool = this.dm.getLogEnabled ( );
			if ( Compare.equals ( PRESUPUESTO_LOC_STAT, 0 ) ) 
			{
				this.dm.setField ( this.dm.get ( "PRESUPUESTO_LOC_DSD" ), "MAYORES_60", DETERMINAR_ELEGIBILIDAD_TANFE.getANCIANO_COUNT ( this.app ) );
				this.dm.setField ( this.dm.get ( "PRESUPUESTO_LOC_DSD" ), "INCAPACITADOS", DETERMINAR_ELEGIBILIDAD_TANFE.getINCAPACITADO_COUNT ( this.app ) );
				this.dm.setField ( this.dm.get ( "PRESUPUESTO_LOC_DSD" ), "MIEMBROS", DETERMINAR_ELEGIBILIDAD_TANFE.getMIEMBROS_FAMILIA_COUNT( ( this.app ) ));
				this.dm.setField ( this.dm.get ( "PRESUPUESTO_LOC_DSD" ), "RECURSOS", MathService.plus ( DETERMINAR_ELEGIBILIDAD_TANFE.getRECURSOS_ACUM ( this.app ), DETERMINAR_ELEGIBILIDAD_TANFE.getRECURSOS_LIQUIDOS ( this.app )  ) );
				this.dm.setField ( this.dm.get ( "PRESUPUESTO_LOC_DSD" ), "RMO_OFICINA", this.app.RMO_GBL );
				this.dm.setField ( this.dm.get ( "PRESUPUESTO_LOC_DSD" ), "SEGURO_SOCIAL_JEFE_FAM", this.app.SS_JEFE_GBL );
				this.dm.setField ( this.dm.get ( "PRESUPUESTO_LOC_DSD" ), "RMO_OFICINA", this.app.RMO_GBL );
				this.dm.setField ( this.dm.get ( "PRESUPUESTO_LOC_DSD" ), "MENORES", DETERMINAR_ELEGIBILIDAD_TANFE.getMENOR_COUNT ( this.app ) );
				this.dm.setField ( this.dm.get ( "PRESUPUESTO_LOC_DSD" ), "BENEFICIO", pago);
				this.dm.setField ( this.dm.get ( "PRESUPUESTO_LOC_DSD" ), "INGRESO_NETO_CPA", DETERMINAR_ELEGIBILIDAD_TANFE.getINGRESOS_NUCLEO(  this.app ) );
				this.dm.setLogEnabled ( false );
				PRESUPUESTO_LOC_STAT  = this.dm.update ( PRESUPUESTO_LOC );
				this.dm.setLogEnabled ( tempBool );
			}
			else
			{
				this.dm.setField ( this.dm.get ( "PRESUPUESTO_LOC_DSD" ), "SEGURO_SOCIAL_JEFE_FAM", this.app.SS_JEFE_GBL );
				this.dm.setField ( this.dm.get ( "PRESUPUESTO_LOC_DSD" ), "SEGURO_SOCIAL_JEFE_SERV", this.app.SS_SERV_GBL );
				this.dm.setField ( this.dm.get ( "PRESUPUESTO_LOC_DSD" ), "COD_SERVICIO", this.app.COD_SERV_GBL );
				this.dm.setField ( this.dm.get ( "PRESUPUESTO_LOC_DSD" ), "RMO_OFICINA", this.app.RMO_GBL );
				this.dm.setField ( this.dm.get ( "PRESUPUESTO_LOC_DSD" ), "MAYORES_60", DETERMINAR_ELEGIBILIDAD_TANFE.getANCIANO_COUNT ( this.app ) );
				this.dm.setField ( this.dm.get ( "PRESUPUESTO_LOC_DSD" ), "INCAPACITADOS", DETERMINAR_ELEGIBILIDAD_TANFE.getINCAPACITADO_COUNT ( this.app ) );
				this.dm.setField ( this.dm.get ( "PRESUPUESTO_LOC_DSD" ), "MIEMBROS", DETERMINAR_ELEGIBILIDAD_TANFE.getMIEMBROS_FAMILIA_COUNT( ( this.app ) ));
				this.dm.setField ( this.dm.get ( "PRESUPUESTO_LOC_DSD" ), "RECURSOS", MathService.plus ( DETERMINAR_ELEGIBILIDAD_TANFE.getRECURSOS_ACUM ( this.app ), DETERMINAR_ELEGIBILIDAD_TANFE.getRECURSOS_LIQUIDOS ( this.app )  ) );
				this.dm.setField ( this.dm.get ( "PRESUPUESTO_LOC_DSD" ), "MENORES", DETERMINAR_ELEGIBILIDAD_TANFE.getMENOR_COUNT ( this.app ) );
				this.dm.setField ( this.dm.get ( "PRESUPUESTO_LOC_DSD" ), "BENEFICIO", pago);
				this.dm.setField ( this.dm.get ( "PRESUPUESTO_LOC_DSD" ), "INGRESO_NETO_CPA", DETERMINAR_ELEGIBILIDAD_TANFE.getINGRESOS_NUCLEO(  this.app ) );
				this.dm.setLogEnabled ( false );
				PRESUPUESTO_LOC_STAT  = this.dm.insertRow ( PRESUPUESTO_LOC );
				this.dm.setLogEnabled ( tempBool );
			}
			if ( ! Compare.equals ( PRESUPUESTO_LOC_STAT, 0 ) ) 
			{
				this.app.setError ( 0, PRESUPUESTO_LOC_STAT );
			}
			PRESUPUESTO_LOC_STAT  = this.dm.dbCommit ( );
			PRESUPUESTO_LOC_STAT  = this.dm.dbClose ( PRESUPUESTO_LOC );
		}
		return;
	}
